import React, { useState } from 'react';
import { Container, Typography, Card, CardContent, Button, Select, MenuItem, FormControl, InputLabel } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import './Team.css'; // Import the CSS file
import FooterMenu from './FooterMenu'; // Import FooterMenu component

const Team = () => {
  const navigate = useNavigate(); // Hook to navigate between pages
  const [teamData, setTeamData] = useState({
    registeredMembers: 0,
    validMembers: 0,
    teamIncome: 0.00,
    cumulativeTeamSize: 0, // Added cumulative team size
    generations: [
      {
        percentage: 18,
        teamCommission: 0,
        registeredMembers: 0,
        validMembers: 0,
        teamIncome: 0.00,
      },
      {
        percentage: 6,
        teamCommission: 0,
        registeredMembers: 0,
        validMembers: 0,
        teamIncome: 0.00,
      },
      {
        percentage: 3,
        teamCommission: 0,
        registeredMembers: 0,
        validMembers: 0,
        teamIncome: 0.00,
      },
    ],
  });

  // For filter state
  const [filter, setFilter] = useState('All');

  const handleFilterChange = (event) => {
    setFilter(event.target.value);
    // Logic to handle filtering data based on the selected option
    // (this can be customized based on your actual data)
  };

  const handleViewTeamList = () => {
    navigate('/team-list'); // Navigate to the team list page
  };

  return (
    <div className="page-container">
      <Container maxWidth="lg" className="page-content">
        <Typography variant="h4" className="page-title">
          My Team
        </Typography>

        {/* Team Data Overview */}
        <div className="overview-card">
          <div className="overview-item">
            <h3>Registered Members</h3>
            <p>{teamData.registeredMembers}</p>
          </div>
          <div className="overview-item">
            <h3>Valid Members</h3>
            <p>{teamData.validMembers}</p>
          </div>
          <div className="overview-item">
            <h3>Team Income</h3>
            <p>${teamData.teamIncome.toFixed(2)}</p>
          </div>
          <div className="overview-item">
            <h3>Cumulative Team Size</h3>
            <p>{teamData.cumulativeTeamSize}</p> {/* Cumulative team size added */}
          </div>
        </div>

        {/* Filter Section */}
        <div className="filter-section">
          <FormControl fullWidth variant="outlined">
            <InputLabel>Filter</InputLabel>
            <Select
              value={filter}
              onChange={handleFilterChange}
              label="Filter"
            >
              <MenuItem value="All">All</MenuItem>
              <MenuItem value="Last 3 Days">Last 3 Days</MenuItem>
              <MenuItem value="This Week">This Week</MenuItem>
              <MenuItem value="This Month">This Month</MenuItem>
              <MenuItem value="Cancel">Cancel</MenuItem>
            </Select>
          </FormControl>
        </div>

        {/* Button to view team list */}
        <Button
          variant="contained"
          color="primary"
          fullWidth
          onClick={handleViewTeamList}
          style={{ marginTop: '20px' }}
        >
          View Team List
        </Button>

        {/* Generations Data */}
        <Typography variant="h6" className="page-title" style={{ marginTop: '40px' }}>
          The Last Three Generations of Data
        </Typography>
        <div className="generations-container">
          {teamData.generations.map((generation, index) => (
            <Card key={index} className="generation-card">
              <CardContent>
                <Typography variant="h6">{`Generation ${index + 1}`}</Typography>
                <Typography variant="body1">Percentage: {generation.percentage}%</Typography>
                <Typography variant="body1">Team Commission: ${generation.teamCommission}</Typography>
                <Typography variant="body1">Registered Members: {generation.registeredMembers}</Typography>
                <Typography variant="body1">Valid Members: {generation.validMembers}</Typography>
                <Typography variant="body1">Team Income: ${generation.teamIncome.toFixed(2)}</Typography>
              </CardContent>
            </Card>
          ))}
        </div>
      </Container>

      {/* Footer */}
      <FooterMenu />
    </div>
  );
};

export default Team;
